import React from "react";

const Movies = (props) => {
  const { data } = props;

  return (
    <div>
      {/* {console.log(data.length)} */}
      {/* <p>{data.length} movies.</p> */}
      <ul>
        {data.map((m) => {
          return <li key={m.id}>{m.title}</li>;
        })}
      </ul>
    </div>
  );
};

export default Movies;
